// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DeadmansSwitch {
    address public owner;
    address public beneficiary;
    uint256 public lastAliveBlock;
    uint256 public thresholdBlocks = 10; // Threshold of 10 blocks

    // Events
    event StillAlive(address indexed owner, uint256 blockNumber);
    event FundsSentToBeneficiary(address indexed beneficiary, uint256 amount);

    constructor(address _beneficiary) {
        require(_beneficiary != address(0), "Beneficiary address cannot be zero");
        owner = msg.sender;
        beneficiary = _beneficiary;
        lastAliveBlock = block.number;
    }

    // Function to reset the last alive block
    function still_alive() external {
        require(msg.sender == owner, "Only the owner can call this function");
        lastAliveBlock = block.number;
        emit StillAlive(owner, block.number);
    }

    // Check and trigger the deadmanâ€™s switch
    function check_and_transfer() external {
        require(block.number > lastAliveBlock + thresholdBlocks, "Owner is still alive");
        uint256 contractBalance = address(this).balance;
        require(contractBalance > 0, "No funds to transfer");

        // Transfer funds to beneficiary
        (bool success, ) = beneficiary.call{value: contractBalance}("");
        require(success, "Transfer to beneficiary failed");
        emit FundsSentToBeneficiary(beneficiary, contractBalance);
    }

    // Allow contract to receive ETH
    receive() external payable {}
}

